const triggerEvent = async (body, eventName = 'c4s_event') => {
  const res = await fetch('https://tss-webhooks.herokuapp.com/api/events/trigger/'+eventName, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(body)
  })
  return await res.text()
}
const getDownloadUrls = async (cid) => {
  const res = await fetch('https://www.clips4sale.com/account/clips/' + cid)
  const text = await res.text()
  const matches = text.matchAll(/"videoUrl":"([^"]+)"/g)
  if(matches) {
    return [...matches].map(m => m[1])
  }
  return []
}
const getClipIdsForPage = async (pageNum) => {
  const res = await fetch('https://www.clips4sale.com/account/clips?page=' + pageNum)
  const text = await res.text()
  const matches = text.matchAll(/data-item-id="(\d+)"/g)
  if(matches) {
    const ret = [...matches].map(m => m[1])
    return ret
  }
  return []
}
const getAllClipIds = async () => {
  let currentPage = 1
  let result = []
  while(true) {
    const ids = await getClipIdsForPage(currentPage)
    if(ids.length === 0) {
      break
    }
    currentPage += 1
    result = [...result, ...ids]
  }
  return result
}
const getUsername = () => {
  const text = document.body.innerHTML
  const m = text.match(/<div class="text-sm leading-none font-semibold">(\w+)<\/div>/)
  return m && m[1] ? m[1] : ''
}

